//   {name: "Teardrops On My Guitar", year: "2007", album: "Taylor Swift", rate_by_me: "Good", length: "3.35", image: "./tog.jpg"},
//   {name: "Our Song", year: "2007", album: "Taylor Swift", rate_by_me: "Really Good", length: "3.24", image: "./our_song.jpg"}

class DisplayList extends Component {


    render() {
        return (
            <div>
                {this.props.list.map(item =>
                    <li>
                        <h2 style={{paddingLeft:'20px'}}>
                        {item.name}
                        </h2>
                        <h4 style={{paddingLeft:'20px'}}>
                        {item.album}
                        </h4>


                        <img src={item.image} height={150} width={150} />

                        <h6 style={{paddingLeft:'20px'}}>
                            Year released: {item.year}
                        </h6>
                        <h6 style={{paddingLeft:'20px'}}>
                            Rate by me: {item.rate_by_me}
                        </h6>
                        <h6 style={{paddingLeft:'20px'}}>
                            Duration: {item.length}
                        </h6>
                        <button style={{margin:'20px'}} onClick={() => this.props.add_list(item)}>Add to Playlist</button>
                    </li>


                )}
            </div>
        )
    }
}

export default DisplayList
